import "../../../index.css";
export default function DoRegistration() {
    return (
        <div style={{ display: "flex",
        marginLeft: "312px", }}>
      <table>
      <tr>
      <th scope="col">날짜</th>
      <th scope="col">이름</th>
      <th scope="col">성별</th>
    </tr>
      </table>
      </div>
      
    );
}
